export type RestMethod = 'post' | 'get'

export const server = "http://localhost:5173"

export const host = "http://localhost:8050"

export function noauthReq(url: string,method: RestMethod,body?: unknown){
  if(method == 'get'){
    return fetch(host + url, {
      method: method
    });
  }
  return fetch(host + url, {
    method: method,
    headers: (body instanceof FormData ? {} : { "Content-Type": "application/json" }),
    body: (body instanceof FormData ? body : JSON.stringify(body)),
  });
}

export type UserRole = "CLIENT" | "ADMIN"

export type LoginResp = {
  email: string,
  role: UserRole,
  token: string
}

export function authReq(url: string, method: RestMethod, body?: unknown) {

  const authStr = localStorage.getItem("auth")

  if(authStr == null){
    window.location.replace(server + Links.auth.login)
    return Promise.resolve(new Response());
  }

  const auth: LoginResp = JSON.parse(localStorage.getItem("auth")!)

  if(method == 'get'){
    return fetch(host + url, {
      method: method,
      headers: {
        Authorization: "Bearer " + auth.token,
      }
    }).then(async (resp) => {
      if (resp.status == 403) {
        window.location.replace(server + Links.auth.login);
        return Promise.resolve(new Response());
      }
      return resp;
    });
  }

  const headers: {
    Authorization: string,
    "Content-Type"?: string
  } = {
    "Authorization": "Bearer " + auth.token,
  }

  if(!(body instanceof FormData)) headers["Content-Type"] = "application/json";

  return fetch(host + url, {
    method: method,
    headers: headers,
    body: (body instanceof FormData ? body : JSON.stringify(body)),
  }).then(async resp => {
    if(resp.status == 403){
      window.location.replace(server + Links.auth.login)
      return Promise.resolve(new Response());
    }
    return resp
  });
}

